import React, {useEffect} from "react";

function App() {
  useEffect(()=>{
    axios.get("https://newsapi.org/v2/top-headines?country=in&apiKey=fd4ef2f1e25b46a692448544e2d9f3f4")
    .then((res)=>{
      console.log(res,"res")
    })
  },[])
  return(
    <>
    <h1>Hello</h1>
    </>
  )
}
export default App;
